-08 10:31:54','','Шикарный дом в Марьяливо КИЗ','','publish','closed','open','','%d1%88%d0%b8%d0%ba%d0%b0%d1%80%d0%bd%d1%8b%d0%b9-%d0%b4%d0%be%d0%bc-%d0%b2-%d0%bc%d0%b0%d1%80%d1%8c%d1%8f%d0%bb%d0%b8%d0%b2%d0%be-%d0%ba%d0%b8%d0%b7','','','2020-04-08 14:33:48','2020-04-08 11:33:48','',25,'http://localhost/buildings/?post_type=buildings&#038;p=28',0,'buildings','',0),(29,1,'2020-04-08 13:36:29','2020-04-08 10:36:29','','Продается очень уютный дом в живописном месте','','publish','closed','open','','%d0%bf%d1%80%d0%be%d0%b4%d0%b0%d0%b5%d1%82%d1%81%d1%8f-%d0%be%d1%87%d0%b5%d0%bd%d1%8c-%d1%83%d1%8e%d1%82%d0%bd%d1%8b%d0%b9-%d0%b4%d0%be%d0%bc-%d0%b2-%d0%b6%d0%b8%d0%b2%d0%be%d0%bf%d0%b8%d1%81%d0%bd','','','2020-04-08 14:38:46','2020-04-08 11:38:46','',24,'http://localhost/buildings/?post_type=buildings&#038;p=29',0,'buildings','',0),(30,1,'2020-04-08 14:04:29','2020-04-08 11:04:29','<strong>4/5</strong> кирпичный, площадь 67/47/9, 2 лоджии застекленные + вагонка, телефон: есть, год постройки 1992, год кап.ремонта 2019, Мебель, встроенные шкафы, металлическая дверь, стеклопакеты, стоянка автомобиля, бытовая техника, подвал, домофон, срочно, центр города, готова к проживанию. Продается 3-х комнатная квартира в центре Гродно, по улице Захарова,частично возможен безличный расчет ,пешком: исторический центр- 7 минут, Центральный рынок - 3 минуты, школа - 5 минут, гимназия - 15 минут, магазины, автовокзал - 5 минут. Встроенные: кухня с бытовой техникой аристон, комната(мебель), коридор- мебель. Кирпичный дом, звукоизоляция, один подъезд, оптоволокно, телефон, большой сухой подвал. особенность- удобная лоджия из кухни, везде стеклопакеты, ламинат, плитка на кухне. Удобная планировка, две лоджии, не слышен шум городского транспорта. Не исключается вариант с мебелью, холодильник Бош. Продажа без посредников. Телефон: ватсап, вайбер, телеграмм','Продажа 3-х комнатной квартиры','','publish','closed','open','','%d0%bf%d1%80%d0%be%d0%b4%d0%b0%d0%b6%d0%b0-3-%d1%85-%d0%ba%d0%be%d0%bc%d0%bd%d0%b0%d1%82%d0%bd%d0%be%d0%b9-%d0%ba%d0%b2%d0%b0%d1%80%d1%82%d0%b8%d1%80%d1%8b','','','2020-04-08 15:07:55','2020-04-08 12:07:55','',24,'http://localhost/buildings/?post_type=buildings&#038;p=30',0,'buildings','',0),(31,1,'2020-04-08 14:06:10','2020-04-08 11:06:10','Гродненская область, г. Гродно\r\n\r\n<strong>12/19</strong> монолитный, площадь 101/70/15, 2 лоджии, телефон: есть, год постройки 2011, Мебель, металлическая дверь, сигнализация, стеклопакеты, счетчики воды, домофон, готова к проживанию, зеленая зона, свободная планировка, квартира для VIP, новостройка. Квартира расположена на двенадцатом этаже 19-и этажного монолитного дома повышенной комфортности, в живописном, тихом месте возле р. Неман. Из окон квартиры панорамный вид на весь город. Уникальное расположение дома на берегу реки, отлично для прогулок, велопрогулок, бега. 2 балкона, 2 ванных, 2 санузла, входная металлическая дверь, полностью меблирована, встроенная техника (посудомоечная машина, варочная панель), на полу ламинат, в коридорах, ванне, туалете и кухне плитка. Просторная квартира современной планировки, встроенная кухня из ламинированного МДФ с фурнитурой БЛЮМ. Комнаты изолированные, большая студио 50 м2 с просторной кухней 15 м2. В шаговой доступности находятся супермаркеты «АЛМИ» и «ЕВРООПТ», рынок, кинотеатр, больница, остановки общественного транспорта, в 50 метрах находится лесопарковая зона, благоустроенный двор, детские площадки, удобная парковка, видеонаблюдение, респектабельные соседи. Всех приглашаем на просмотр.','Продажа 4-х комнатной квартиры в г. Гродно','','publish','closed','open','','31','','','2020-04-08 15:08:44','2020-04-08 12:08:44','',24,'http://localhost/buildings/?post_type=buildings&#038;p=31',0,'buildings','',0),(32,1,'2020-04-08 14:11:00','2020-04-08 11:11:00','','img001','','inherit','open','closed','','img001','','','2020-04-08 14:11:00','2020-04-08 11:11:00','',26,'http://localhost/buildings/wp-content/uploads/2020/04/img001.jpg',0,'attachment','image/jpeg',0)