ние, внутренняя отделка: цементно-песчаная стяжка пола (дополнительно гидроизоляция полов в санузлах), штукатурка стен из керамзитобетонных блоков, внутриквартирные перегородки из ГКЛВ.','1-комнатная квартира в Новостройке','','publish','closed','open','','1-%d0%ba%d0%be%d0%bc%d0%bd%d0%b0%d1%82%d0%bd%d0%b0%d1%8f-%d0%ba%d0%b2%d0%b0%d1%80%d1%82%d0%b8%d1%80%d0%b0-%d0%b2-%d0%bd%d0%be%d0%b2%d0%be%d1%81%d1%82%d1%80%d0%be%d0%b9%d0%ba%d0%b5','','','2020-04-08 15:06:51','2020-04-08 12:06:51','',25,'http://localhost/buildings/?post_type=buildings&#038;p=39',0,'buildings','',0),(40,1,'2020-04-08 15:05:42','2020-04-08 12:05:42','','img007','','inherit','open','closed','','img007','','','2020-04-08 15:05:42','2020-04-08 12:05:42','',39,'http://localhost/buildings/wp-content/uploads/2020/04/img007.jpg',0,'attachment','image/jpeg',0),(41,1,'2020-04-08 16:51:51','2020-04-08 13:51:51','','Продажа 3-х комнатной квартиры','','publish','closed','open','','%d0%bf%d1%80%d0%be%d0%b4%d0%b0%d0%b6%d0%b0-3-%d1%85-%d0%ba%d0%be%d0%bc%d0%bd%d0%b0%d1%82%d0%bd%d0%be%d0%b9-%d0%ba%d0%b2%d0%b0%d1%80%d1%82%d0%b8%d1%80%d1%8b-2','','','2020-04-08 16:51:51','2020-04-08 13:51:51','',25,'http://localhost/buildings/?post_type=buildings&#038;p=41',0,'buildings','',0),(42,1,'2020-04-08 16:51:42','2020-04-08 13:51:42','','img008','','inherit','open','closed','','img008','','','2020-04-08 16:51:42','2020-04-08 13:51:42','',41,'http://localhost/buildings/wp-content/uploads/2020/04/img008.jpg',0,'attachment','image/jpeg',0),(43,1,'2020-04-08 16:59:08','2020-04-08 13:59:08','Продается просторная 3-комнатная квартира в центре города по адресу ул. Горновых.\r\n\r\nРасположена на 7-ом этаже 10-этажного кирпичного дома 1991 года постройки. Отличный панорамный вид их окон на р.Неман и старый город.\r\n\r\nКвартира без современного ремонта, но полностью готова для заселения и обустройства новым хозяином. Есть стеклопакеты, металлическая дверь, встроенные шкафы-командоры и встроенный кухонный гарнитур.\r\n\r\nОтличается хорошей планировкой: окна на разные стороны, просторная кухня – 9,3 квадрата, большая лоджия; в коридоре есть место под встроенный шкаф или небольшую гардеробную.\r\n\r\nДом находится в хорошем месте, со всей необходимой инфраструктурой и в 5-ти минутах ходьбы от центра.','Трешка с панорамным видом в центре','','publish','closed','open','','%d1%82%d1%80%d0%b5%d1%88%d0%ba%d0%b0-%d1%81-%d0%bf%d0%b0%d0%bd%d0%be%d1%80%d0%b0%d0%bc%d0%bd%d1%8b%d0%bc-%d0%b2%d0%b8%d0%b4%d0%be%d0%bc-%d0%b2-%d1%86%d0%b5%d0%bd%d1%82%d1%80%d0%b5','','','2020-04-08 16:59:08','2020-04-08 13:59:08','',24,'http://localhost/buildings/?post_type=buildings&#038;p=43',0,'buildings','',0),(44,1,'2020-04-08 17:08:13','2020-04-08 14:08:13','<img class=\"alignnone size-medium wp-image-48\" src=\"http://localhost/buildings/wp-content/uploads/2020/04/91c516e462-225x300.jpg\" alt=\"\" width=\"225\" height=\"300\" />','Продажа 2-х комнатной квартиры','','publish','closed','open','','%d0%bf%d1%80%d0%be%d0%b4%d0%b0%d0%b6%d0%b0-2-%d1%85-%d0%ba%d0%be%d0%bc%d0%bd%d0%b0%d1%82%d0%bd%d0%be%d0%b9-%d0%ba%d0%b2%d0%b0%d1%80%d1%82%d0%b8%d1%80%d1%8b','','','2020-04-08 17:08:38','2020-04-08 14:08:38','',24,'http://localhost/buildings/?post_type=buildings&#038;p=44',0,'buildings','',0),(45,1,'2020-04-08 17:13:04','2020-04-08 14:13:04','Продаётся 3 комн. квартира в г.Гродно, ул. Дзержинского, 127. 1 этаж 7 этажного дома, в хорошем спальном районе г. Гродно. За 5-10 минут на машине либо общественном транспорте вы доеди́те до центра города, а также ко всем основным достопримечательностям.\r\n\r\nДом 1991г.п. после реконструкции в 2019-2020 гг. К основным преимуществам дома можно отнести теплоту в квартирах. Квартира с хорошим ремонтом, готова сразу к проживанию. Есть все счетчики. Чистый аккуратный подъезд\r\n\r\nИменно здесь, Вы найдете все для комфортного проживания: детские площадки, детские сады, школы (в том числе польская), магазины (до Old City 5 минут пешком), поликлиника, женская консультация, парикмахерская, аптеки, банки, почта, мини рынок «Девятовка», общественный транспорт, парковки.\r\n\r\nКвартира отлично подойдет студентам, рядом находятся ГрГМУ, ГрГУ им. Я. Купалы.\r\n\r\nТакже можно рассмотреть вариант перевода в нежилой фонд.','3 комн квартира на Девятовке','','publish','closed','open','','3-%d0%ba%d0%be%d0%bc%d0%bd-%d0%ba%d0%b2%d0%b0%d1%80%d1%82%d0%b8%d1%80%d0%b0-%d0%bd%d0%b0-%d0%b4%d0%b5%d0%b2%d1%8f%d1%82%d0%be%d0%b2%d0%ba%d0%b5','','','2020-04-08 17:46:24','2020-04-08 14:46:24','',24,'http://localhost/buildings/?post_type=buildings&#038;p=45',0,'buildings','',0),(46,1,'2020-04-08 16:57:19','2020-04-08 13:57:19','','img009','','inherit','open','closed','','img009','','','2020-04-08 16:57:19','2020-04-08 13:57:19','',43,'http://localhost/buildings/wp-content/uploads/2020/04/img009.jpg',0,'attachment','image/jpeg',0),(47,1,'2020-04-08 17:02:33','2020-04-08 14:02:33','','img010','','inherit','open','closed','','img010','','','2020-04-08 17:02:33','2020-04-08 14:02:33','',44,'http://localhost/buildings/wp-content/uploads/2020/04/img010.jpg',0,'attachment','image/jpeg',0),(48,1,'2020-04-08 17:04:50','2020-04-08 14:04:50','','91c516e462','','inherit','open','closed','','91c516e462','','','2020-04-08 17:04:50','2020-04-08 14:04:50','',44,'http://localhost/buildings/wp-content/uploads/2020/04/91c516e462.jpg',0,'attachment','image/jpeg',0),(49,1,'2020-04-08 17:12:59','2020-04-08 14:12:59','','img011','','inherit','open','closed','','img011','','','2020-04-08 17:12:59','2020-04-08 14:12:59','',45,'http://localhost/buildings/wp-content/uploads/2020/04/img011.jpg',0,'attachment','image/jpeg',0),(50,1,'2020-04-08 18:08:26','2020-04-08 15:08:26','','grodno-rejting','','inherit','open','closed','','grodno-rejting','','','2020-04-08 18:08:26','2020-04-08 15:08:26','',24,'http://localhost/buildings/wp-content/uploads/2020/04/grodno-rejting.jpg',0,'attachment','image/jpeg',0),(52,1,'2020-04-08 20:24:31','2020-04-08 17:24:31','[objectsList]\r\n\r\n[citiesList]\r\n[addCityForm]','Home',''